    provided only partial employer and/or occupation information.  Please note that
    all of these conduit contributors are below the 'in excess of $200' threshold
    requiring reporting of occupation and employer information for conduit contributors.
    See 11 CFR 110.6(c)(1)(iv)(A).\n"
